import { BASE_API_URL } from '../constants.js';

export async function getKantoPokemons() {
    try {
        const response = await fetch(`${BASE_API_URL}/pokemon?limit=151`);
        console.log(response);
        const data = await response.json();
        //console.log(data);
        return data;
    } catch (e){
        console.log(e)
    }
}
